class Solution(object):
    def lengthOfLongestSubstring(self, s):
        """
        :type s: str
        :rtype: int
        """
        longestLength = 0
        for x in range(len(s)):
            usedChars = ""
            length = 0
            currentString = s[x:]
            for i in currentString:
                if i in usedChars:
                    longestLength = longestLength if not length > longestLength else length
                    break
                usedChars += i
                length += 1
                longestLength = longestLength if not length > longestLength else length
        return longestLength

